import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
// don't change anything above this line when using react. 
import App from './App';
import * as serviceWorker from './serviceWorker';

ReactDOM.render(<App/>, document.getElementById('root'));
serviceWorker.unregister(); //used to support offline applications
